        the Trump special master case be substantially reversed by end of year?\",\"contractSlug\":\"will-the-trump-special-master-case\",\"userName\":\"BTE\",\"id\":\"jvcclosHtTrF2Tf0HQev\",\"commentType\":\"contract\",\"userUsername\":\"BTE\",\"replyToCommentId\":\"Y1vCgyIeC9EsXEJZGIST\",\"userId\":\"4JuXgDx47xPagH5mcLDqLzUSN5g2\",\"contractId\":\"z8awccgKF9qEreoG6FsH\",\"commenterPositionProb\":0.9862381333247052,\"commenterPositionOutcome\":\"YES\",\"content\":{\"content\":[{\"content\":[{\"attrs\":{\"label\":\"jack\",\"id\":\"DGgg2oLYm35ErbquWjT6\"},\"type\":\"mention\"},{\"text\":\"
        First the Special Master told Trump's lawyers he couldn't understand how executive
        privilege applied and then the appeals court basically let Cannon save some
        face and she took them up on it. She realized Trump was only going to drag
        her down. \",\"type\":\"text\"}],\"type\":\"paragraph\"},{\"type\":\"paragraph\"},{\"content\":[{\"type\":\"text\",\"text\":\"What
        is becoming very apparent is the judges are starting to get really pissed
        at Trump's lawyers because they won't answer for the things Trump is saying
        on TV since they aren't going to commit perjury. This is getting out of hand
        before it even really gets started. I am starting to think Trump is going
        to be held without bail or completely gagged when he is charged because a
        judge isn't gonna just sit back and take personal threats when they have the
        power to literally silence anyone on all channels through force of court order.
        He needs to shut up or he won't even get the fight he seems to be itching
        for. \"}],\"type\":\"paragraph\"}],\"type\":\"doc\"},\"commenterPositionShares\":831,\"userAvatarUrl\":\"https://firebasestorage.googleapis.com/v0/b/mantic-markets.appspot.com/o/user-images%2FBTE%2F7-M4WLXUQh.jpeg?alt=media&token=5245ad8e-bc0c-4eef-ae63-dccbd38a0908\"},{\"createdTime\":1664229300190,\"userAvatarUrl\":\"https://firebasestorage.googleapis.com/v0/b/mantic-markets.appspot.com/o/user-images%2FBTE%2F7-M4WLXUQh.jpeg?alt=media&token=5245ad8e-bc0c-4eef-ae63-dccbd38a0908\",\"commenterPositionOutcome\":\"YES\",\"content\":{\"content\":[{\"type\":\"paragraph\",\"content\":[{\"type\":\"mention\",\"attrs\":{\"id\":\"DGgg2oLYm35ErbquWjT6\",\"label\":\"jack\"}},{\"text\":\"
        The important point here is that Cannon radically altered her original order
        such that not only does it change substantively, it eliminated the possibility
        Trump can appeal again to the supreme court because she has said he cannot
        show he could be harmed in his capacity as former Executive in any way by
        the continuing of the criminal investigation.\",\"type\":\"text\"}]}],\"type\":\"doc\"},\"contractSlug\":\"will-the-trump-special-master-case\",\"replyToCommentId\":\"Y1vCgyIeC9EsXEJZGIST\",\"commenterPositionShares\":831,\"commentType\":\"contract\",\"id\":\"auuX5PdHE63wr2PIgObt\",\"contractQuestion\":\"Will
        the Trump special master case be substantially reversed by end of year?\",\"commenterPositionProb\":0.9862381333247052,\"contractId\":\"z8awccgKF9qEreoG6FsH\",\"userUsername\":\"BTE\",\"userId\":\"4JuXgDx47xPagH5mcLDqLzUSN5g2\",\"userName\":\"BTE\"},{\"contractSlug\":\"will-the-trump-special-master-case\",\"userId\":\"4JuXgDx47xPagH5mcLDqLzUSN5g2\",\"commenterPositionShares\":831,\"commenterPositionOutcome\":\"YES\",\"userAvatarUrl\":\"https://firebasestorage.googleapis.com/v0/b/mantic-markets.appspot.com/o/user-images%2FBTE%2F7-M4WLXUQh.jpeg?alt=media&token=5245ad8e-bc0c-4eef-ae63-dccbd38a0908\",\"createdTime\":1664229199633,\"commenterPositionProb\":0.9862381333247052,\"contractId\":\"z8awccgKF9qEreoG6FsH\",\"content\":{\"type\":\"doc\",\"content\":[{\"content\":[{\"attrs\":{\"label\":\"jack\",\"id\":\"DGgg2oLYm35ErbquWjT6\"},\"type\":\"mention\"},{\"text\":\"
