        going off of BTE's article, the part that seems most relevant to this question
        is this: \",\"type\":\"text\"}],\"type\":\"paragraph\"},{\"type\":\"blockquote\",\"content\":[{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"Cannon
        on Thursday issued a revised order stating that the special master in the
        case would review all documents \\\"except the approximately one-hundred documents
        bearing classification markings.\\\" She also struck two portions from her
        original order preventing the DOJ from probing the classified documents during
        the special master review and requiring them to disclose the materials to
        the special master\"}]}]},{\"type\":\"paragraph\",\"content\":[{\"text\":\"The
        most egregious part of the order by far was the inability for DOJ to review
        the documents marked as classified. In addition, I believe that, absent this
        amendment, the 11th Circuit would have made a stronger reversal\",\"type\":\"text\"}]},{\"type\":\"blockquote\",\"content\":[{\"type\":\"paragraph\",\"content\":[{\"text\":\"The
        three-judge panel \u2014 which included two Trump appointees \u2014 said Cannon,
        a fellow Trump-appointee, \\\"abused\\\" her discretion by barring the DOJ
        from continuing to investigate the classified documents seized from Trump's
        Mar-a-Lago residence and allowed investigators to resume their probe.\",\"type\":\"text\"}]}]},{\"content\":[{\"type\":\"text\",\"text\":\"Given
